func GetFS() webdav.FileSystem {
  FS := webdav.NewMemFS()

  err := CTX.Err()
  if err != nil {
		panic(err)
	}


  
  err = FS.Mkdir(CTX, "config/", 0777)
  if err != nil && err != os.ErrExist {
    panic(err)
  }
  


  var f webdav.File

  

  
  

  f, err = FS.OpenFile(CTX, "config/default.yaml", os.O_RDWR|os.O_CREATE|os.O_TRUNC, 0777)
  if err != nil {
    panic(err)
  }

  
  _, err = f.Write(FileConfigDefaultYaml)
  if err != nil {
    panic(err)
  }
  

  err = f.Close()
  if err != nil {
    panic(err)
  }
  

  return FS
}

// Open a file
func (hfs *HTTPFS) Open(path string) (http.File, error) {
  path = hfs.Prefix + path

  f, err := hfs.FS.OpenFile(CTX, path, os.O_RDONLY, 0644)
  if err != nil {
    return nil, err
  }

  return f, nil
}

// ReadFile is adapTed from ioutil
func ReadFile(path string) ([]byte, error) {
  raw, pres := Inventory[path]
  if !pres {
     return nil, os.ErrNotExist
  }

  

  return raw, nil

  
}

// WalkDirs looks for files in the given dir and returns a list of files in it
// usage for all files in the b0x: WalkDirs("", false)
func WalkDirs(fs webdav.FileSystem, name string, includeDirsInList bool, files ...string) ([]string, error) {
	f, err := fs.OpenFile(CTX, name, os.O_RDONLY, 0)
	if err != nil {
		return nil, err
	}

	fileInfos, err := f.Readdir(0)
	if err != nil {
    return nil, err
  }

  err = f.Close()
  if err != nil {
		return nil, err
	}

	for _, info := range fileInfos {
		filename := path.Join(name, info.Name())

		if includeDirsInList || !info.IsDir() {
			files = append(files, filename)
		}

		if info.IsDir() {
			files, err = WalkDirs(fs, filename, includeDirsInList, files...)
			if err != nil {
				return nil, err
			}
		}
	}

	return files, nil
}

